import React from 'react';
function CreateTicket() {
    return ( 
        <div className='container'>
            <div className='row mt-3'>
                <h4>To create a ticket, select a relevent topic</h4>
                <div className='col-4 mt-5 '>
                    <h6></h6>

                </div>

            </div>
        </div>
    );
}

export default CreateTicket;
